import React from 'react';
import styled from 'styled-components';

const TextComponent = styled('p')`
    margin: 0;
`;

export default class Text extends React.PureComponent<> {
    render () {
        return (
            <TextComponent>{this.props.children}</TextComponent>
        )
    }
}
